var title_f19_35_20027="Syndromes fetal macrosomia";
var content_f19_35_20027=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F62116&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F62116&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Genetic syndromes frequently associated with macrosomia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Syndrome",
"       </td>",
"       <td class=\"subtitle1\">",
"        Main characteristics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Beckwith-Wiedemann",
"       </td>",
"       <td>",
"        Macroglossia, omphalocele, macrosomia, ear creases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marshall-Smith",
"       </td>",
"       <td>",
"        Accelerated growth and maturation, shallow orbits, broad middle phalanges",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Simpson-Golabi-Behmel",
"       </td>",
"       <td>",
"        Macrocephaly, coarse face, ocular hypertelorism, broad flat nose, macrostomia, macroglossia, nail hypoplasia, skeletal abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sotos (cerebral gigantism)",
"       </td>",
"       <td>",
"        Large size, large hands and feet, poor coordination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Berardinelli lipodystrophy",
"       </td>",
"       <td>",
"        Lipoatrophy, phallic hypertrophy, hepatomegaly, hyperlipemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Weaver",
"       </td>",
"       <td>",
"        Macrosomia, accelerated skeletal maturation, camptodactyly, unusual facies",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Jones KL. Smith's Recognizable Patterns of Human Malformation. WB Saunders, Philadelphia 2006.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
