var title_f19_35_20028="Features of Mansonella spp II";
var content_f19_35_20028=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F70668&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F70668&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Features of mansonella species causing human infection - II",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        M. streptocera",
"       </td>",
"       <td class=\"subtitle1\">",
"        M. ozzardi",
"       </td>",
"       <td class=\"subtitle1\">",
"        M. perstans",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Diagnosis",
"       </td>",
"       <td>",
"        Microfilariae (mf)&nbsp;in skin snips. Differentiated from mf&nbsp;of Onchocerca volvulus by small size (180 to 240 micrometers) and characteristic sharp curve in tip of tail (\"shepherd's crook\").",
"       </td>",
"       <td>",
"        Microfilariae (mf) in blood and occasionally in skin snips. Differentiated from other circulating mf by lack of significant periodicity, small size (170 to 240 micrometers long), absence of sheath and absence of terminal nuclei.",
"       </td>",
"       <td>",
"        Microfilariae (mf) in blood (or rarely&nbsp;serosal effusions). Differentiated from other circulating mf by lack of significant periodicity, small size (190 to 200 micrometers), absence of sheath, and round terminal nucleus at the tip of the tail.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Other laboratory findings",
"       </td>",
"       <td>",
"        Peripheral eosinophilia is common.",
"       </td>",
"       <td>",
"        Peripheral eosinophilia is common.",
"       </td>",
"       <td>",
"        Peripheral eosinophilia and elevated serum IgE are common.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Treatment",
"       </td>",
"       <td>",
"        Diethylcarbamazine (6 mg/kg/day&nbsp;orally for 14 days) is effective against adults and microfilariae (mf) but associated with significant side effects. Ivermectin (150 mcg/kg orally) is effective in reducing mf.*",
"       </td>",
"       <td>",
"        Ivermectin (200 mcg/kg orally) is the treatment of choice.",
"        <sup>",
"         &bull;",
"        </sup>",
"        Diethylcarbamazine is ineffective.",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        Recommend therapy with albendazole (400 mg&nbsp;orally BID for 10 days) or mebendazole (100 mg&nbsp;orally&nbsp;twice daily&nbsp;for 30 days) is generally inefective.",
"        <sup>",
"         &loz;",
"        </sup>",
"        Doxycycline (200 mg&nbsp;orally daily for six weeks) clears mf for up to 36 months.",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     * Fischer, P, et al. J Infect Dis 1999; 180:1403.",
"     <br>",
"      &bull; Nutman, TB, et al. J Infect Dis 1987; 156:662; Gonzalez, AA, et al. West Indian Med J 1999; 48:231.",
"      <br>",
"       &Delta; Bartholomew CF, et al. Trans R Soc Trop Med Hyg 1978; 72:423.",
"       <br>",
"        &loz; Bregani ER, et al. Trans R Soc Trop Med Hyg 2006; 100:458.",
"        <br>",
"         &sect; Coulibaly YI, et al. N Eng J Med 2009; 361:1448.",
"         <br/>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
